import React from 'react'
import {View} from "react-native";

type Props = {
    question: string;
    answers: string[];
    callback: any;
    userAnswer: string;
    numQuestion: number;
    totalQuestions: number;
}

const QuestionCard: React.FC<Props> = ({question, answers}) => {
    return(
        <View >
            Question Card
        </View>
    )
}

export default QuestionCard
